/**
 * 根据传入的 format 字符串获取 format 配置
 * @param  format 格式,如 percent，percent(2),fixed,fixed(2)
 * @returns
 * ```ts
 * {
 *   type: string,
 *   value: string
 * }
 * ```
 */
export default function getFormatConfig(format: string): {
    type?: undefined;
    value?: undefined;
} | {
    type: string;
    value: string;
};
